script: |
  super -f text -I q3404.spq | sort > q3404.out

inputs:
  - name: q3404.spq
    data: |
      SELECT col1 * + col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - col0 + - col2 AND - ( ( - col1 ) ) * ( + col2 ) - 28 * + 63;
  - name: tab0

outputs:
  - name: q3404.out
    data: |
